import React from "react";
import { useState } from "react";
import { Container, Grid, Typography, TextField, TextareaAutosize } from '@mui/material';
import contact_form from '../images/contact_form.png';

export default function Contact() {

function MyForm() {
    const [inputs, setInputs] = useState({});

    const handleChange = (event) => {
      const name = event.target.name;
      const value = event.target.value;
      setInputs(values => ({...values, [name]: value}))
    }

    const handleSubmit = (event) => {
      event.preventDefault();
      console.log(inputs);
    }


    return(
        <div>
            <Container disableGutters maxWidth={false} className='dark_gray_bg pb_50 pt_100 contact_form'>
<Container fixed>

<Grid container spacing={5}>
<Grid item xs={6}>
<img src={contact_form} alt="Contact" />
    </Grid>
    <Grid item xs={6}>

    <Typography gutterBottom variant="h4" component="div">
Get in touch
</Typography>
<form onSubmit={handleSubmit}>
      <label>Enter your name:
      <input 
        type="text" 
        name="username" 
        value={inputs.username || ""} 
        onChange={handleChange}
      />
      </label>
      <label>Enter your age:
        <input 
          type="number" 
          name="age" 
          value={inputs.age || ""} 
          onChange={handleChange}
        />
        </label>
        <input type="submit" />
    </form>
    </Grid>
    </Grid>
    </Container>
    </Container>
        </div>
    )
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<MyForm />);
}
